script: |
  super -f text -I q4419.spq | sort > q4419.out

inputs:
  - name: q4419.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE ( - 30 - ( - - col1 ) - + col1 + - + 14 + 70 * ( 28 ) * + col0 - - col2 * - col0 * col2 ) NOT IN ( - col1 * col2 );
  - name: tab1

outputs:
  - name: q4419.out
    data: |
      51	14	96
      85	5	59
      91	47	68
